<script>
import anime from "animejs";

export default {
  name: "Session4Page2",
  methods: {
    animateText() {
      let text = document.getElementsByClassName('text-box')[0].children;
      let textspan = document.querySelectorAll('.text')[0];
      let animation = anime.timeline({
        easing: 'linear',
        duration: 700,
        delay: 700
      });
      animation
        .add({
          targets: text[1],
          opacity: 1
        })
        .add({
          targets: text[2],
          opacity: 1
        })
        .add({
          targets: text[3],
          opacity: 1
        })
        .add({
          targets: textspan,
          color: '#000'
        }, 2800)
        .add({
          targets: '.instruction-container',
          opacity: 1
        })
    },
    animateHeartBeat() {
      document.querySelector('.heart').style.opacity = '1';
      anime({
        targets: '.heart',
        scale: 0.7,
        direction: 'alternate',
        easing: 'easeInOutQuad',
        duration: 300,
        endDelay: 200,
        loop: true
      });
    },
    animateDroplets() {
      let vh = window.innerHeight;
      let droplets = document.querySelectorAll('.droplet');
      anime({
        targets: droplets[0],
        translateY: 0.1*vh,
        opacity: [
          {value: 1, duration: 1000},
          {value: 0, duration: 1000}
        ],
        loop: true,
        duration: 2000,
        easing: 'linear'
      })
      anime({
        targets: droplets[1],
        translateY: 0.1*vh,
        opacity: [
          {value: 1, duration: 700},
          {value: 0, duration: 700}
        ],
        loop: true,
        delay: 200,
        duration: 1400,
        easing: 'linear',
      })
      anime({
        targets: droplets[2],
        translateY: 0.1*vh,
        opacity: [
          {value: 1, duration: 800},
          {value: 0, duration: 800}
        ],
        loop: true,
        delay: 500,
        duration: 1600,
        easing: 'linear'
      })
    },
    animateButterfly() {
      let vw = document.querySelector('.interactive-container').clientWidth;
      let vh = window.innerHeight;
      let butterflies = document.querySelectorAll('.butterfly');
      butterflies.forEach(bf => {
        bf.style.opacity = '1'
      })
      anime({
        targets: butterflies[0],
        translateX: [
          {value: -0.03 * vw, duration: 2000, endDelay: 300},
          {value: 0.02 * vw, duration: 2000, endDelay: 300},
        ],
        duration: 4600,
        loop: true
      })
      anime({
        targets: butterflies[1],
        translateX: [
          {value: -0.03 * vw, duration: 2000, endDelay: 300},
          {value: 0.02 * vw, duration: 2000, endDelay: 300},
        ],
        translateY: [
          {value: +0.03 * vh, duration: 2000, endDelay: 300},
          {value: -0.02 * vh, duration: 2000, endDelay: 300},
        ],
        duration: 4600,
        delay: 300,
        direction: 'alternate',
        loop: true
      })
    },
    animatePointer() {
      let vw = document.querySelector('.interactive-container').clientWidth;
      anime({
        targets: '.pointer',
        translateX: -0.05*vw,
        duration: 300,
        endDelay: 800,
        loop: true,
        easing: 'linear'
      })
    },
    changeCoord(id) {
      switch (id) {
        case '#mask-1':
          document.querySelector('.instruction-container').style.bottom = '2%';
          break;
        case '#mask-2':
          document.querySelector('.instruction-container').style.bottom = '54%';
          document.querySelector('.instruction-container').style.right = '4%';
          break;
      }
    },
    displayClues(id) {
      switch (id) {
        case '#mask-1':
          this.displayHeart(id);
          break;
        case '#mask-2':
          this.displayButterfly(id);
          break;
        case '#mask-3':
          this.displayDroplet(id);
          break;
      }
    },
    displayHeart(id) {
      document.querySelector(id).style.visibility = 'hidden';
      this.animateHeartBeat();
      let text = document.querySelectorAll('.text')[1];
      anime({
        targets: text,
        color: '#000',
        duration: 700,
        easing: 'linear'
      });
      this.$refs.heartBeat.play();
      this.changeCoord(id)
    },
    displayButterfly(id) {
      document.querySelector(id).style.visibility = 'hidden';
      this.animateButterfly();
      let text = document.querySelectorAll('.text')[2];
      anime({
        targets: text,
        color: '#000',
        duration: 700,
        easing: 'linear'
      });
      this.changeCoord(id)
    },
    displayDroplet(id) {
      document.querySelector(id).style.visibility = 'hidden';
      this.animateDroplets();
      let text = document.querySelectorAll('.text')[3];
      let animation = anime.timeline({
        duration: 700,
        easing: 'linear'
      })
      animation
        .add({
          targets: text,
          color: '#000'
        })
        .add({
          targets: '#prompt',
          opacity: 1,
          delay: 700
        })
      document.querySelector('.instruction-container').style.visibility = 'hidden';
    }
  },
  mounted() {
    this.animateText();
    // this.animateDroplets();
    // this.animateButterfly();
    this.animatePointer();
  }
}
</script>

